settings.cellContentFunction:
return '<div style="padding: 1px;width: 50%;text-align: center;background-color: #324095;">' +
            '<span style="color: white; font-size: 15px;">' + value + ' devices</span>' +
        '</div>';

settings.markdownCss:
.tb-markdown-view .tb-progress-cover, .tb-markdown-view .mat-drawer-container {
    background-color: #fff;
}

.tb-markdown-view div, .tb-markdown-view p {
    line-height: normal;
}

.tb-markdown-view > div {
    padding: 0;
}

.market-layout {
    position: relative;
}

.market-title {
    font-size: 26px;
    padding-bottom: 16px;
    padding-left: 10px;
    padding-top: 5px;
}

.state-filter-title {
    padding-bottom: 15px;
    padding-left: 10px;
}

.market-layout .alarm-badges-layout {
    position: absolute;
    height: 50px;
    top: 0;
    left: 0;
    right: 0;
    z-index: 2;
    display: flex;
    justify-content: center;
    pointer-events: none;
}

.market-layout .alarm-badges-layout .alarm-badges {
    height: 50px;
    width: 350px;
    pointer-events: all;
}

config.widgetCss:
.tb-widget-container .tb-widget .tb-multiple-input {
    background-color: #FAFAFA;
    border-radius: 4px;
}

.tb-widget-container .tb-widget .tb-multiple-input .input-field {
    padding-right: 30px;
}

.tb-widget-container .tb-widget .tb-multiple-input mat-slide-toggle {
    margin-top: 15px !important;
    margin-bottom: 0 !important;
}

.tb-widget-container .tb-widget .tb-multiple-input .mat-slide-toggle-content {
    width: 120px;
}

.tb-widget-container .tb-widget .mat-slide-toggle-bar {
    width: 42px;
    height: 24px;
    border-radius: 16px;
}

.tb-widget-container .tb-widget .mat-slide-toggle-thumb-container {
    top: 2px;
    left: 2px;
}

.tb-widget-container .tb-widget .mat-slide-toggle.mat-checked .mat-slide-toggle-thumb-container {
    transform: translate3d(18px, 0, 0);
}

.tb-widget-container .tb-widget .mat-slide-toggle-thumb {
    background-color: #fafafa;
}

.tb-widget-container .tb-widget .mat-slide-toggle.mat-checked .mat-slide-toggle-bar {
    background-color: #F2994A;
}

settings.markerImageFunction:
var isActive = dsData[dsIndex]['active'];
var res;

if (isActive == "true") {
	res = {
	    url: images[1],
	    size: 10
	}
} else {
    res = {
	    url: images[0],
	    size: 10
	}
}

return res;

